import './App.css';
import React from 'react';

function App() {
  return (
    <div>
      <header style={headerStyle}>
        <nav style={menuStyle}>
          <ul style={menuListStyle}>
            <li style={menuItemStyle}>First</li>
            <li style={menuItemStyle}>Second</li>
            <li style={menuItemStyle}>Third</li>
            <li style={menuItemStyle}>Fourth</li>
          </ul>
        </nav>
        <div>
          <button >Login</button>
          <button style={buttonStyle}>Sign Up</button>
        </div>
      </header>
      <section style={sectionStyle}>
        <h1>Welcome to My Hotel</h1>
        <p>Explanations about your hotel go here.</p>
      </section>
    </div>
  );
}

// CSS styles
const headerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  padding: '20px',
  backgroundColor: '#f2f2f2',
};

const menuStyle = {
  display: 'flex',
};

const menuListStyle = {
  listStyle: 'none',
  display: 'flex',
};

const menuItemStyle = {
  marginRight: '10px',
};

const buttonStyle = {
  marginLeft: '10px',
};

const sectionStyle = {
  padding: '20px',
};

export default App;
